var AbstractAPRSMessage = require('./AbstractAPRSMessage.js');

var instance = null;

function APRSMessage() {
    var instance = this;
    
    instance.number = '';
	instance.addressee = '';
	instance.message = '';
	instance.groupName = '';
    
	AbstractAPRSMessage.apply(instance, arguments);
}

APRSMessage.prototype = new AbstractAPRSMessage();
APRSMessage.prototype.constructor = APRSMessage;

APRSMessage.prototype.parent = AbstractAPRSMessage.prototype;

module.exports = APRSMessage;